import React from 'react';

import Search from './Search';

import Me from '../img/me.png'

import './style.css';

export default function Header() {
    return (
        <header>
            <Search/>
            <ul>
                <li>
                    <div className="Amigos" >
                        <img src={Me} alt="" />
                        <span>Amigos</span>
                    </div>
                </li>
            </ul>
            
            <hr/>
            
        </header>
    );
}
